import React from "react";

import { Button, Wrapper, Section } from "..";

export const RequestDemo = () => (
  <Wrapper>
    <Section description="Ready to grow your business?">
      <Button type="lightColor">Request Demo</Button>
    </Section>
  </Wrapper>
);

export default RequestDemo;
